            _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](235, "16.1. El deber de actualizaci\u00F3n de datos por parte del titular El titular de los datos tiene la obligaci\u00F3n de mantener actualizados los datos personales que haya suministrado a GRUPO PREVENIR. Hasta el m\u00E1ximo permitido por la Ley, GRUPO PREVENIR no se hace responsable por la falta de actualizaci\u00F3n de datos personales por parte del titular de los mismos. 16.2. CONSULTAS: GRUPO PREVENIR dispone de mecanismos para que el titular, sus causahabientes, sus representantes y/o apoderados, aquellos que por estipulaci\u00F3n a favor de otro o para otro est\u00E9n legitimados, los representantes de menores de edad titulares, formulen CONSULTAS respecto de cu\u00E1les son los datos personales del titular que reposan en las bases de datos de GRUPO PREVENIR. Estos mecanismos podr\u00E1n ser f\u00EDsicos como a trav\u00E9s del correo electr\u00F3nico de pqrs@prevenirexpress.com o del cont\u00E1ctenos de nuestra web encargados de recepcionar las peticiones, quejas y reclamos. Cualquiera que sea el medio, GRUPO PREVENIR guardar\u00E1 prueba de la consulta y su respuesta. 16.3 Antes de proceder, el responsable de atender la consulta verificar\u00E1: La identidad del titular del dato personal o su representante. Para ello, exigir\u00E1 la c\u00E9dula de ciudadan\u00EDa o documento de identificaci\u00F3n original del titular y los poderes especiales o generales seg\u00FAn sea el caso. 16.4 La autorizaci\u00F3n o contrato con terceros que dieron origen al Tratamiento del dato personal del titular, por parte de GRUPO PREVENIR. Si el solicitante tuviere capacidad para formular la consulta, el responsable de atenderla recopilar\u00E1 toda la informaci\u00F3n sobre el titular que est\u00E9 contenida en el registro individual de esa persona o que est\u00E9 vinculada con la identificaci\u00F3n del titular dentro de las bases de datos de GRUPO PREVENIR. 16.5 El responsable de atender la consulta dar\u00E1 respuesta al solicitante siempre y cuando \u00E9ste \u00FAltimo tuviere derecho a ello por ser el titular del dato personal, su causahabiente, su representante y/o apoderado, aquellos que por estipulaci\u00F3n a favor de otro o para otro est\u00E9n legitimados, o el responsable legal en el caso de menores de edad. Esta respuesta ser\u00E1 enviada dentro de los diez (10) d\u00EDas h\u00E1biles contados a partir de la fecha en la que la solicitud fue recibida por GP. Esta respuesta ser\u00E1 obligatoria a\u00FAn en los casos en que se considere que el solicitante no tiene capacidad para realizar la consulta, en cuyo caso as\u00ED se le informar\u00E1 al solicitante y se dar\u00E1 opci\u00F3n de que demuestre el inter\u00E9s y capacidad aportando documentaci\u00F3n adicional. En caso de que la solicitud no pueda ser atendida a los diez (15) h\u00E1biles, se contactar\u00E1 al solicitante para comunicarle los motivos por los cuales el estado de su solicitud se encuentra en tr\u00E1mite y se\u00F1alando la fecha en la que se atender\u00E1 la consulta, la cual en ning\u00FAn caso podr\u00E1 superar los cinco (5) d\u00EDas h\u00E1biles siguientes al vencimiento del primer t\u00E9rmino. Para ello se utilizar\u00E1 el mismo medio o uno similar a aquel mediante el cual fue presentada la consulta. La respuesta definitiva a todas las solicitudes no puede tardar m\u00E1s de quince (15) d\u00EDas h\u00E1biles desde la fecha en la que la solicitud inicial fue recibida por GP. ");
