    // tslint:disable-next-line:typedef
    RolesPermisosComponent.prototype.cambiarSwicth = function () {
        if (this.personal && this.personal.length >= 1) {
            for (var i = 0; i < this.personal.length; i++) {
                if (this.personal[i].tipoCuenta === 'medico') {
                    this.userService.saveLocalStorage('servicios', 'estado');
                    this.cambioEstado.emit('servicios');
                    return;
                }
            }
            this.appService.swal('Advertencia', 'Por favor agrega al menos un médico antes de continuar', 'warning');
            return;
        }
        this.appService.swal('Advertencia', 'Por favor agrega al menos un médico antes de continuar', 'warning');
    };
    RolesPermisosComponent.prototype.agregarPersonal = function () {
        var _this = this;
        // Validacion si el usuario tiene permisos para crear personal
        if (this.permisos.permisos(1, 0, 0, 'crear')) {
            // Validacion si el tipo de empresa es consultorio y alzanzo el limite de empleados
            if ((this.personal && this.personal.length >= 1) && this.user.tipoEmpresa === 'Consultorio') {
                this.empresaService.getNumeroEmpleados(this.user.idSucursales).subscribe(function (res) {
                    if (res[0].medicos >= 2 || res[0].empleados >= 2) {
                        _this.appService.swal('Advertencia', 'Solo puedes registrar maximo 2 medicos o empleados.', 'warning');
                        return;
                    }
                    else {
                        _this.editar = 'crear';
                        document.getElementById('btn-agregar-empleado').click();
                    }
                });
                return;
            }
            this.editar = 'crear';
            document.getElementById('btn-agregar-empleado').click();
        }
    };
