    PerfilSocialEmpresaComponent.prototype.previsualizarImagen = function (event) {
        var _this = this;
        var reader = new FileReader();
        if (event.target.files && event.target.files.length > 0) {
            var file_1 = event.target.files[0];
            console.log(event.target.files);
            this.imagenSubir = file_1;
            reader.readAsDataURL(file_1);
            if (file_1.type === 'image/png' ||
                file_1.type === 'image/jpg' ||
                file_1.type === 'image/jpeg' ||
                file_1.type === 'image/PNG' ||
                file_1.type === 'image/JPG' ||
                file_1.type === 'image/JPEG') {
                reader.onload = function () {
                    _this.fileName = file_1.name + ' ' + file_1.type;
                    _this.filePreview = 'data:image/png' + ';base64,' + reader.result.split(',')[1];
                    if (_this.arrayImagenes.length <= 5) {
                        _this.arrayImagenes.push(_this.filePreview);
                    }
                    else {
                        _this.appService.swal('Advertencia', 'Solo se admiten subir 6 imagenes.', 'warning');
                    }
                };
            }
            else {
                this.appService.swal('Advertencia', 'Solo se admiten imagenes tipo png, jpg, jpeg.', 'warning');
            }
        }
    };
